namespace AsmodatStandardTest.Extensions.Imaging
{
    [TestFixture]
    public class QRScannerTest
    {
        [Test]
        public void EncodeDecodeRaw()
        {
            var data = RandomEx.NextBytes(128).ToBase64String();

            var scaner = new QRScanner();
            var bmp = scaner.Create(data);
            var result = scaner.ScanText(bmp);
            Assert.AreEqual(data, result);
        }

        [Test]
        public void EncodeDecodeQ75()
        {
            var data = RandomEx.NextBytes(128).ToBase64String();
            var scaner = new QRScanner();
            var bmp = scaner.Create(data);

            var jpg = (Bitmap)bmp.Convert(ImageFormat.Jpeg, quality: 75);

            var result = scaner.ScanText(jpg);

            Assert.AreEqual(data, result);
        }

        [Test]
        public void EncodeDecodeQ10()
        {
            var data = RandomEx.NextBytes(64).ToBase64String();
            var scaner = new QRScanner();
            var png = scaner.Create(data);

            var jpg = (Bitmap)png.Convert(ImageFormat.Jpeg, quality: 10);

            //var str = $"data:image/png;base64,{jpg.CloneRGB24Bit().Convert(ImageFormat.Png).ToByteArray().ToBase64String()}";

            var result = scaner.ScanText(jpg);

            Assert.AreEqual(data, result);
        }

        [Test]
        public void EncodeDecodeImageSharpQ1()
        {
            var data = RandomEx.NextBytes(64).ToBase64String();
            var scaner = new QRScanner();
            var bmp = scaner.Create(data);

            var jpg = bmp.ImageSharpConvert(ImageFormat.Jpeg, quality: 1);

            var str = $"data:image/jpg;base64,{jpg.ToImageSharpByteArray().ToBase64String()}";
            var bmp2 = str.DataImageToBitmapWithImageSharp();

            var result = scaner.ScanText(bmp2);

            Assert.AreEqual(data, result);
        }

        [Test]
        public void EncodeDecodeImageSharpQ2()
        {
            var data = RandomEx.NextBytes(64).ToBase64String();
            var scaner = new QRScanner();
            var img = scaner.CreateImage(data);
            var result = scaner.ScanText(img);
            Assert.AreEqual(data, result);


            var jpg = img.Convert(JpegFormat.Instance, quality: 2);

            var str = $"data:image/jpg;base64,{jpg.ToByteArray(format: "jpg").ToBase64String()}";
            var jpg2 = str.DataImageToBitmapWithImageSharp();

            var result2 = scaner.ScanText(jpg2);

            Assert.AreEqual(data, result2);
        }

        
        [Test]
        public async Task HelloWorldDecodeImageSharp()
        {
            var data = "data:image/png;base64,";
            var png = data.DataImageToImageSharpImage();

            var bmp24 = (Image<Rgb24>)png.Convert(BmpFormat.Instance, bmpBitsPerPixel: BmpBitsPerPixel.Pixel24);

            var tpng = await QRScannerEx.DrawTargetAsync(png);

            var pink = $"data:image/bmp;base64,{tpng.ToByteArray(BmpFormat.Instance, bmpBitsPerPixel: BmpBitsPerPixel.Pixel24).ToBase64String()}";


            var cpng = await QRScannerEx.CropTargetAsync(tpng);

            var pink2 = $"data:image/bmp;base64,{cpng.ToByteArray(BmpFormat.Instance, bmpBitsPerPixel: BmpBitsPerPixel.Pixel24).ToBase64String()}";

            var scaner = new QRScanner();

            var bmp8 = png.Convert(
                PngFormat.Instance, 
                bmpBitsPerPixel: BmpBitsPerPixel.Pixel8,
                pngBitDepth: PngBitDepth.Bit2,
                pngColorType: PngColorType.Palette);


            var str = $"data:image/bmp;base64,{bmp8.ToByteArray(BmpFormat.Instance, bmpBitsPerPixel: BmpBitsPerPixel.Pixel24).ToBase64String()}";

            var result = scaner.ScanText(bmp8);
            Assert.AreEqual("Hello World", result);


        }

    }
}
